Öncelikle elinize sağlık böyle bir uygulamanın hayata geçmesi çok önemliydi. Programı geliştirebilmek adına görüş bildirmek istedim;
Ailem  ile ilgili olan kısımda bir aile üyesi eklediğinde onaylaması için bildirim gelebilir. Ayrıca ailem ile ilgili durumu göremiyorum herhangi bir şey belirtmiyor. Yoğunluk sekmesindeki tablerdeki geçişlerde oldukça beklemek gerekiyor belki sorgulama hızlandırılabilir. Bir de program, konumu kullanmyı onaylarken kendi kendini kapatıyor.
Umarım işinize yarar bir geriş dönüş olur. Kolay gelsin 👏🏻

